import { createUserWithEmailAndPassword } from "./firebase";
import { auth, usersCollectionRef, addDoc } from "./firebase";

const registerFBUser = (e, email, password, firstname, lastname, dob) => {
  e.preventDefault();
  createUserWithEmailAndPassword(auth, email, password)
    .then((userCredential) => {
      addDoc(usersCollectionRef, {
        userUID: userCredential.user.uid,
        firstName: firstname,
        lastName: lastname,
        birthday: dob,
        email: userCredential.user.email,
        prevPass: [],
        pwExpired: false,
        role: "",
        activated: false,
        suspended: false,
        suspensionStart: "",
        suspensionEnd: "",
        username: "",
        password: password,
      });
      console.log(userCredential);
    })
    .catch((error) => {
      console.log(error);
    });
};

export default registerFBUser;
